import React, { Component } from "react";

class Post extends Component {
  render() {
    return (
      <div className="post">
        <h2>Id: {this.props.post.id}</h2>
        <h2>Title: {this.props.post.title}</h2>
        <h2>Author: {this.props.post.author}</h2>
      </div>
    );
  }
}

export default Post;
